window.bookSummaryJSON = "<p>Lola Pink is all shades of concerned about the state of her wedding plans when her world is shaken as someone close to Dane Clark - her billionaire fiance - goes missing. When the news of a kidnapping rocks the Clark Castle, Lola finds herself entwined in a mystery that could require a trip down memory lane. </p> <p>However, a missing-persons report is not the only thing on Lola's plate. There's a brownie rivalry between two of the town's oldest residents, a wedding cake that won't order itself, and a mother-in-law determined to ruin Lola's special day. But when the kidnapper's threats take a turn for the worse, suddenly, all bets are off. If Lola can't find a way to unveil the kidnapper's true identity, there won't be a wedding to ruin....</p>"; 
